	if (user) {
	  return formatName(user);
	}
	return 'Stranger';
}

const name = {
	firstName: 'Ashley',
	lastName: 'P'
};
function Welcome(props) {
	return <h1>Hello, {props.name}</h1>;
  }
class Test extends Component{
	render(){
		return(
			<div className="App">
			<h1> Hello, World! {getGreeting(name)} </h1>
			<h1> Hello, World! {getGreeting()} </h1>
			</div>
		);
	}
}

export default Test;
